import React from 'react';

import categorieImg from '../../assets/categorie.png';

import {
  Container,
  Header,
  Title,
  CategoriesList,
  Item,
  ItemImage,
  ItemTitle,
} from './styles';

export default function Categories() {
  return (
    <Container>
      <Header>
        <Title>Categorias</Title>
      </Header>

      <CategoriesList horizontal>
        <Item>
          <ItemImage
            source={{
              uri:
                'https://pagoquandopuder.com.br/wp-content/uploads/2019/09/Comida-saud%C3%A1vel-n%C3%A3o-%C3%A9-mais-cara-740x493.jpg',
            }}
            src={categorieImg}
          />
          <ItemTitle>brasileira</ItemTitle>
        </Item>
      </CategoriesList>
    </Container>
  );
}
